INSERT INTO `problem_tb` VALUES (1,'2023-02-10 07:22:26.000000','보다 쉬운 더하기 문제 입니다. 두 정수 A 와 B 를 입력 받은 다음, A + B 를 출력하는 프로그램을 작성해주세요. (언어 선택에 유의해주세요! JAVA 선택 시 클래스명은 Main 으로 설정해주세요.)','첫째 줄에 A 와 B 가 한 칸의 간격을 두고 주어집니다. (0 < A, B < 10)',128,'보다 쉬운 A + B','첫째 줄에 A + B 를 출력해주세요.','100','100','1 2','3',2,'SILVER4'),(2,'2023-02-10 07:22:26.000000','보다 쉬운 빼기 문제입니다. 두 정수 A 와 B 를 입력 받은 다음, A - B 를 출력하는 프로그램을 작성해주세요. (언어 선택에 유의해주세요! JAVA 선택 시 클래스명은 Main 으로 설정해주세요.)','첫째 줄에 A 와 B 가 한 칸의 간격을 두고 주어집니다. (0 < A, B < 10)',128,'보다 쉬운 A - B','첫째 줄에 A - B 를 출력해주세요.','100','100','3 2','1',2,'SILVER4'),(3,'2023-02-10 07:22:26.000000','보다 쉬운 곱하기 문제입니다. 두 정수 A 와  B 를 입력 받은 다음, A × B 를 출력하는 프로그램을 작성해주세요. (언어 선택에 유의해주세요! JAVA 선택 시 클래스명은 Main 으로 설정해주세요.)','첫째 줄에 A 와 B 가 한 칸의 간격을 두고 주어집니다. (0 < A, B < 10)',256,'보다 쉬운 A × B','첫째 줄에 A × B 를 출력해주세요.','100','100','1 2','2',1,'SILVER4'),(4,'2023-02-10 07:22:26.000000','보다 쉬운 나누기 문제입니다. 두 정수 A 와  B 를 입력받은 다음, A /  B 를 출력하는 프로그램을 작성해주세요. (언어 선택에 유의해주세요! JAVA 선택 시 클래스명은 Main 으로 설정해주세요.) ','첫째 줄에 A 와 B 가 한 칸의 간격을 두고 주어집니다. (0 < A, B < 10)',128,'보다 쉬운 A / B','첫째 줄에 A / B 를 출력해주세요. 실제 정답과 출력 값의 절대 오차 또는 상대 오차가 10 의 -9 제곱 이하이면 정답 입니다.','100','100','4 5','0.8',2,'SILVER5'),(5,'2023-02-10 07:22:26.000000','아주 약간 어려운 더하기 문제입니다. 두 정수 A 와 B 를 입력 받은 다음, A + B 를 출력하는 프로그램을 작성해주세요. (언어 선택에 유의해주세요! JAVA 선택 시 클래스명은 Main 으로 설정해주세요.)','이 문제는 입력이 개행을 기준으로 주어집니다. 첫째 줄에 A, 둘째 줄에 B 가 주어집니다.  (0 < A, B < 10)',128,'고난도 A + B (1) ','첫째 줄에 A + B 를 출력해주세요.','100','100','1(개행)2','3',1,'SILVER5'),(6,'2023-02-10 07:22:26.000000','조금 어려운 더하기 문제입니다. 두 정수 A 와 B 를 입력 받은 다음, A + B 를 출력 하는 프로그램을 작성해주세요. (언어 선택에 유의해주세요! JAVA 선택 시 클래스명은 Main 으로 설정해주세요.)','이 문제는 테스트 케이스가 주어집니다. 첫 줄에 테스트 케이스의 개수 T 가 주어집니다. 첫 줄에는 테스트 케이스의 개수가 주어지며, 다음 줄 부터 A 와 B 가 한 칸의 간격을 두고 주어집니다. (0 < A, B < 10)',256,'고난도 A + B (2)','각 테스트 케이스마다 A + B 를 개행을 기준으로 출력해주세요.','100','100','5(개행)1 1(개행)2 3(개행)3 4(개행)9 8(개행)5 2','2(개행)5(개행)7(개행)17(개행)7',1,'SILVER5'),(7,'2023-02-10 07:22:26.000000','쉽진 않은 더하기 문제입니다. 두 정수 A 와 B 를