지 궁금합니다. 이를 판단할 수 있는 프로그램을 작성해주세요. (언어 선택에 유의해주세요! JAVA 선택 시 클래스명은 Main 으로 설정해주세요.)','첫 번째 줄은 두 개의 정수 n 과 k(1 ≤ k < n ≤350)를 포함합니다. 두 번째 줄은 n 개의 문자 C 또는 P 의 시퀀스를 포함하며, 여기서 C 는 빨간색 조약돌을, P 는 파란색 조약돌을 의미합니다. 문자 C 는 최소 2k-1 번 나타냅니다.',256,'안툰과 브랑카','안툰이 브랑카의 움직임과 상관없이 이길 수 있다면 DA 를 출력하고, 그렇지 않다면 NE 를 출력해주세요.','100','100','4 1(개행)CCCP','DA',2,'GOLD3'),(12,'2023-02-10 07:22:26.000000','0 에서 9 까지의 숫자로 이루어진 계단 수는 인접한 자리수의 차이가 1 인 수입니다. 예를 들어, 45656 과 232345 같은 수가 계단 수입니다. N 자리 수에서 계단 수가 몇 개 있는지 구하는 프로그램을 작성하세요.  (언어 선택에 유의해주세요! JAVA 선택 시 클래스명은 Main 으로 설정해주세요.)','첫째 줄에 N (1 ≤ N ≤ 100)이 주어집니다.',256,'쉬운 계단 수','첫째 줄에 N 자리 수에서 계단 수가 몇 개 있는지 출력합니다. 1,000,000,000 으로 나눈 나머지를 출력해주세요.','100','100','1','9',2,'GOLD2'),(13,'2023-02-10 07:22:26.000000','사파리 월드는 인터넷으로만 존재하는 미스테리한 나라입니다. 사파리 월드에는 2 개의 서브 도메인이 seunghwan.royal.gov.sw 와 kyuhyun.royal.gov.sw 이 있는데, 이것이 couple.royal.gov.sw 으로 합쳐질 것입니다. 그러나 도메인 관리 센터 SWNIC(센터장: 정도형(feat. 논산))에는 엄격한 룰이 있습니다. 두 서브 도메인을 합칠 때, 유명도의 차이가 너무 차이나지 않을 경우에만 두 서브 도메인을 결혼시키는 것입니다. 서브 도메인의 유명도는 정수입니다. 두 서브 도메인의 유명도가 주어졌을 때, 그 차이를 구하는 프로그램을 작성해주세요. (언어 선택에 유의해주세요! JAVA 선택 시 클래스명은 Main 으로 설정해주세요.)','첫째 줄에 두 도메인의 유명도 N 과 M 이 주어집니다. (-10 ≤ N, M ≤ 10)',128,'사파리 월드','첫째 줄에 두 유명도의 차이 (|N - M|)을 출력헤주세요.','100','100','-2 5','7',1,'GOLD1'),(14,'2023-02-10 07:22:26.000000','Hello World!를 출력하세요!! (언어 선택에 유의해주세요! JAVA 선택 시 클래스명은 Main 으로 설정해주세요.)','이 문제는 입력이 없습니다.',128,'Hello World!','첫째 줄에 Hello World! 를 출력해주세요. 개행은 없습니다!','100','100','이 문제는 입력 예제가 없습니다.','Hello World!',1,'PLATINUM1'),(15,'2023-02-10 07:22:26.000000','알파벳 소문자, 대문자, 숫자 0-9중 하나가 주어졌을 때, 주어진 글자의 아스키 코드값을 출력하는 프로그램을 작성하시오. (언어 선택에 유의해주세요! JAVA 선택 시 클래스명은 Main 으로 설정해주세요.)','알파벳 소문자, 대문자, 숫자 0-9 중 하나가 첫째 줄에 주어진다.',256,'아스키 코드','입력으로 주어진 글자의 아스키 코드 값을 출력한다.','100','100','A','65',1,'DIAMOND1');
